import { connect } from "react-redux"

function mapStateToProps(state) {
    //debugger
    return {
        posts: state.reducerPost.posts
    };
}

export default connect(mapStateToProps)(function Post(props) {
    const { posts } = props
    return (
        <>
            <div>
                <ul>{posts &&
                    posts.map(post => {
                        <li>{post.name}</li>,
                            <li>{post.title}</li>
                    })
                }</ul>
            </div>
        </>
    )
})
